from typing import List
from queue import Queue
from collections import defaultdict

class Solution:
    def minJumps(self, arr: List[int]) -> int:
        if len(arr) <= 1:
            return 0

        d = defaultdict(list)
        for i, n in enumerate(arr):
            d[n].append(i)

        q = Queue()
        q.put((0, 0))
        v = {0}
        while q:
            i, c = q.get()
            if i == len(arr) - 1:
                return c

            cp = c + 1
            e = [i + 1]
            if i - 1 > 0:
                e.append(i - 1)
            e.extend(d.pop(arr[i], []))
            for j in e:
                if j not in v:
                    v.add(j)
                    q.put((j, cp))


